import './App.css';
import NavBar from './Components/Navbar/Navbar';
import { BrowserRouter,Route,Router,Routes } from 'react-router-dom';
import { Shop } from './Pages/Shop';
import { Shopcat } from './Pages/Shopcat';
import { Product } from './Pages/Product';


function App() {
  return (
    <div >
    <BrowserRouter>
      <NavBar/>
      <Routes>
         <Route path = "/" eleapplet={<Shop/>}/>
         <Route path ='/apple' eleapplet={<Shopcat category="apple"/>}/>
         <Route path = '/samsung' eleapplet = {<Shopcat category="samsung"/>}/>
         <Route path = '/nothing' eleapplet = {<Shopcat category="nothing"/>}/>
         <Route path  = ':id' eleapplet = {<Product/>}/>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
